import React, { Component } from "react";
import 'react-multi-carousel/lib/styles.css';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader

 function NotFound(props) {

    return(
    <div className="postphoto">
        <p style={{fontWeight:"900",fontSize:"180px",textAlign:"center"}}>Oops!</p>
        <p style={{fontWeight:"900",fontSize:"20px",textAlign:"center"}}>404 - PAGE NOT FOUND</p>
        <p style={{fontWeight:"900",fontSize:"12px",textAlign:"center"}}>The page you are looking for might have been removed<br/> had it's name changed or is temporary unavilable</p>
    </div>
        );

    }
   
    export default NotFound;
